(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d224ae4"],{e0be:function(e,a){e.exports='<h2 id="一些有趣的前端库和工具">一些有趣的前端库和工具</h2>\n<h3 id="1sakura">1.Sakura</h3>\n<p><img src="https://pic3.zhimg.com/80/v2-c213bcc7a4bf730e6133cc0862ce5ab6_hd.jpg" alt="Sakura"></p>\n<p>Sakura 是一个独特的极简 CSS 框架，无需为 HTML 添加任何类。你只需要将 sakura.css 放到任意页面，它就会继承默认的排版和元素样式。由于没有类，Sakura 能够快速的生成漂亮页面，并且非常容易定制。</p>\n<blockquote>\n<p>项目地址：【<a href="https://github.com/oxalorg/sakura">传送门</a>】</p>\n</blockquote>\n<h3 id="2flvjs">2.Flv.js</h3>\n<p><img src="https://upload-images.jianshu.io/upload_images/675733-ffc24bcc45efbd20.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/785/format/webp" alt="Flv.js"></p>\n<p>Flv.js 是由 bilibili 网站开源的 HTML5 Flash 视频（FLV）播放器，纯原生 JavaScript 开发（ECMAScript 6 编写） ，没有用到 Flash。它的工作原理是 Flv.js 在 JavaScript 中流式解析 flv 文件流，并实时转封装为 fmp4 ，通过 Media Source Extensions 喂给浏览器，实现了 FLV 格式视频的播放。</p>\n<blockquote>\n<p>项目地址：【<a href="https://github.com/Bilibili/flv.js">传送门</a>】</p>\n</blockquote>\n<h3 id="3eaglejs">3.Eagle.js</h3>\n<p><img src="https://pic3.zhimg.com/80/v2-0b93f7748a1b4d37a1efaba5ecbc91c6_hd.jpg" alt="Eagle.js"></p>\n<p>Eagle.js 是一个用于制作基于 Web 幻灯片的 Vue.js 框架，与 Reveal.js 相似。它支持动画、主题、交互小部件（用于 Web 演示），并且可以轻松地在演示文稿之间进行组件、幻灯片和样式的重用。</p>\n<blockquote>\n<p>项目地址：【<a href="https://zulko.github.io/eaglejs-demo/#/">传送门</a>】</p>\n</blockquote>\n<h3 id="4stepper">4.Stepper</h3>\n<p><img src="https://user-gold-cdn.xitu.io/2019/5/13/16aae9a07aa4d12b?imageView2/0/w/1280/h/960/format/webp/ignore-error/1" alt="Stepper"></p>\n<p>非常好的数字步进控件，非常适合上/下式的增减控制或其他计数器控件。点击箭头会产生非常棒的动画与光滑的CSS效果。</p>\n<h3 id="5dropcss">5.DropCSS</h3>\n<p><img src="https://user-gold-cdn.xitu.io/2019/5/13/16aae9a07b2009c2?imageView2/0/w/1280/h/960/format/webp/ignore-error/1" alt="DropCSS"></p>\n<p>Eagle.js 是一个用于制作基于 Web 幻灯片的 Vue.js 框架，与 Reveal.js 相似。它支持动画、主题、交互小部件（用于 Web 演示），并且可以轻松地在演示文稿之间进行组件、幻灯片和样式的重用。</p>\n<blockquote>\n<p>项目地址：【<a href="https://zulko.github.io/eaglejs-demo/#/">传送门</a>】</p>\n</blockquote>\n<h3 id="6react-loadcon">6.React LoadCon</h3>\n<p><img src="https://user-gold-cdn.xitu.io/2019/5/13/16aae9a0b3686b64?imageView2/0/w/1280/h/960/format/webp/ignore-error/1" alt="React LoadCon"></p>\n<p>React组件，允许您使用一系列动态生成的图像来使网站的favicon图标产生动画。这个效果可以用作进度或加载指示器，也可以作为一个很酷的小动画，使您的页面脱颖而出</p>\n<blockquote>\n<p>项目地址：【<a href="https://github.com/foreseaz/react-loadcon">传送门</a>】</p>\n</blockquote>\n<h3 id="7card">7.Card</h3>\n<p><img src="https://lc-gold-cdn.xitu.io/c544e8b41e0ac12e319a?imageView2/0/w/1280/h/960/format/webp/ignore-error/1" alt="Card"></p>\n<p>Card是一个纯JS项目（有jQuery版本）, 提供非常酷的实时展示卡片信息的功能，非常适合用来做有信用卡、驾照等信息的表单</p>\n<blockquote>\n<p>项目地址：【<a href="https://jessepollak.github.io/card/">传送门</a>】</p>\n</blockquote>\n<h3 id="8conversational-form">8.Conversational Form</h3>\n<p><img src="https://lc-gold-cdn.xitu.io/c93210a06cfa4920b53c?imageView2/0/w/1280/h/960/format/webp/ignore-error/1" alt="Conversational Form"></p>\n<p>抛弃了传统表单的形式，采用对话的方式让你来完成表单.Intersting!</p>\n<blockquote>\n<p>项目地址：【<a href="https://space10-community.github.io/conversational-form/landingpage/">传送门</a>】</p>\n</blockquote>\n<h3 id="9docsify">9.docsify</h3>\n<p><img src="https://lc-gold-cdn.xitu.io/6a2358094cf7a718956c?imageView2/0/w/1280/h/960/format/webp/ignore-error/1" alt="docsify"></p>\n<p>文档生成工具，提供非常简单好看的主题， vuejs的文档好像就是这个生成的？</p>\n<blockquote>\n<p>项目地址：【<a href="https://docsify.js.org/#/">传送门</a>】</p>\n</blockquote>\n<blockquote>\n<p>peanut 编辑于 2019-07-08</p>\n</blockquote>\n'}}]);
